import { React, useState } from "react";
//import TextField from 'react'
import {
  StyleSheet,
  Text,
  Button,
  View,
  Image,
  ImageBackground,
  TextInput,
  
} from 'react-native';
//import List from "./Components/List"
import './SearchBarElements.css';
const SearchBar = () => {
  return (
    //<div>SearchBar</div>
    <nav> 
         <ul className="menus">
             <h1>React Search</h1>
             <div className="search">
             <TextInput
                id="outlined-basic"
                variant="outlined"
                //fullWidth
                label="Search"
                />
            </div>
         </ul>
    </nav>
    
       
    
  )
}

export default SearchBar
